  const name = "할아버지";
  return <Mother grandFatherName={name} />;
}

function Mother(aaa) {
  return <Child grandFatherName={aaa.grandFatherName} />;
}

function Child({ grandFatherName }) {
  return <div> {aaa.grandFatherName}</div>;
}

export default App;
